#include<stdio.h>
int main(){
int a = 10;
int b = 30;

if(a==b)
{
printf("%d is a equal to %d", a,b);
}
else if (a!=b)
{
printf("%d is not equal to %d", a,b);
}
else if (a>=b)
{
printf("%d is greater than and equal to %d", a,b);
}
else if (a<=b)
{
printf("%d is less than and equal to %d", a,b);
}
return 0;









}